import "./Posts.css";
import PostItem from "./PostItem";
import React from "react";

function Posts() {
  return (
    <div className="posts__container">
      <PostItem
        title="Completed First React.js Project"
        date="Sep 5, 2021"
        content="3rd quarter has come to an end with the summer semester. The last entry was about self-studying 61A in order to take 61BL but now I have completed 61BL and am planning to take try new things until the end of this year. My 61BL grade is pretty much finalized as a A- which is decent, but it could have been better. Overall, the class was very fun though the assignments were sometimes very challenging. If it were not for Kaifeng, who I have met luckily, things could have been drastically different. But with a good partner, all project grades received full mark (+ bonus mark for the final one though it was painful) and we were able to fill each other’s mistakes and weaknesses.
        I am now eligible to change my major to EMS, Engineering Mathematics and Statistics. If applicable, I may do a double major with EECS because it only needs two more courses to fulfill the requirements, but that’s for later. Once I return to Berkeley in 2022 Spring, I will have one or two summer internship opportunities before graduation which may be a risk as an international student and a rising junior without any previous experience. That said, I am hoping to try out an internship while in Korea if any of them are available.
        Besides my sudden shift in career track, there was nothing much significant besides meeting a new friend. I met her before writing the previous entry in May but did not mention because I didn’t get to know her enough. I met her through Bumble recommended by Woojin back in CFC; I didn’t have much expectation because it intuitively did not seem to be the best place to meet someone in sync. Well surprisingly, she and I had similar background of being the only child, attended an international school in Korea and had overlapping qualities. She initially left to LA three weeks ago but returned to Korea this week. Regardless of how the relationship turns out, I am happy to meet someone in sync with me.
        There have been some ongoing talks with my father about living in Jeju island for a month for various reasons, but I’ll update that in a few weeks along with the LASIK surgery. 
        "
      />
      <PostItem
        title="Finished Data Structure Course"
        date="Aug 13, 2021"
        content=""
      />
      <PostItem
        title="Discharged from the Army"
        date="May 21, 2021"
        content=""
      />
    </div>
  );
}

export default Posts;
